def iconlight():
    from tempfile import mkstemp

    _adwite_light = b""

    _, _adwite_light_temp = mkstemp()

    with open(_adwite_light_temp, "wb") as _adwite_light_file:
        from base64 import b64decode

        _adwite_light_file.write(b64decode(_adwite_light))

    adwite_light_icon = (_adwite_light_temp).replace("\\", "//")

    return adwite_light_icon


def icondark():
    from tempfile import mkstemp

    _adwite_dark = b""

    _, _adwite_dark_temp = mkstemp()

    with open(_adwite_dark_temp, "wb") as _adwite_dark_file:
        from base64 import b64decode

        _adwite_dark_file.write(b64decode(_adwite_dark))

    adwite_dark_icon = (_adwite_dark_temp).replace("\\", "//")

    return adwite_dark_icon


def photolight():
    from tkinter import PhotoImage
    return PhotoImage(file=iconlight())


def photodark():
    from tkinter import PhotoImage
    return PhotoImage(file=icondark())


ICONLIGHT = iconlight()
ICONDARK = icondark()
PHOTOLIGHT = photolight
PHOTODARK = photodark


def icon(window=None, dark=False):
    from .root import root
    window = root(window)
    if dark:
        window.iconphoto(False, PHOTODARK())
    else:
        window.iconphoto(False, PHOTOLIGHT())
